import { useState } from 'react';
import Link from 'next/link';
import Router from 'next/router';
import NProgress from 'nprogress';
import { APP_NAME } from '../../config';
import { signout, isAuth } from '../../actions/auth';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem
} from 'reactstrap';
import '../../node_modules/nprogress/nprogress.css';
import Search from '../blog/Search';
import './style.css'

Router.onRouteChangeStart = url => NProgress.start();
Router.onRouteChangeComplete = url => NProgress.done();
Router.onRouteChangeError = url => NProgress.done();

const UHeader = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div class="hone ml-auto w-100 container-fluid justify-content-start ml-lg-0 d-lg-flex">
                        
    <div class="nav-item h-100">

      <a class="nav-link h-100" href="#">
        <span class="lone align-middle h-100">Notícias & Media</span>
      </a>

    </div>

      <div class="nav-item h-100">

        <a class="ltwo nav-link h-100" href="#">

          <span class="align-middle h-100">
          <img class="h-100 align-middle" id="envi" src="./images/icons/envelope.svg" alt="" width="15" height="15" title="Bootstrap"/>
          </span>

          <span class="align-middle h-100">
          contato@dental04.com
          </span>
            
        </a>

      </div>    

     <div class="nav-item h-100">

      <a class="nav-link h-100" href="#">

        <span class="align-middle h-100">
          <img class="h-100 align-middle" id="cloi" src="./images/icons/alarm.svg" alt="" width="15" height="15" title="Bootstrap"/>
        </span>

        <span class="align-middle h-100">
          Seg-Sáb: 09h - 18h
        </span>
        
          
      </a>

     </div>

     <div class="nav-item h-100">

      <a class="nav-link h-100" href="#">

      <span class="align-middle h-100">
        <img class="align-middle" id="flag" src="./images/icons/flag-brazil.png" alt="" width="25" height="auto" title="Bootstrap"/>
      </span>
      
      <div class="dropdown">
        <span class="align-middle h-100"> 
          PT-BR
        </span>

      </div>

      </a>

    </div>

    <div class="nav-item h-100">

      <a class="nav-link h-100" href="#">
        <span class="align-middle h-100">Entrar</span>
      </a>

    </div>

               
  </div>

  );
};

export default UHeader;
